INSERT INTO [dbo].[faq] ([Id], [question], [answer]) VALUES (1, N'What is Netflix?', N'Netflix is a streaming service that offers a wide variety of award-winning TV shows, movies, anime, documentaries, and more on thousands of internet-connected devices.\n\nYou can watch as much as you want, whenever you want without a single commercial – all for one low monthly price. There''s always something new to discover and new TV shows and movies are added every week!')
INSERT INTO [dbo].[faq] ([Id], [question], [answer]) VALUES (2, N'How much does Netflix cost?', N'Watch Netflix on your smartphone, tablet, Smart TV, laptop, or streaming device, all for one fixed monthly fee. Plans range from EUR8.99 to EUR17.99 a month. No extra costs, no contracts.')
INSERT INTO [dbo].[faq] ([Id], [question], [answer]) VALUES (3, N'Where can I watch?', N'Watch anywhere, anytime. Sign in with your Netflix account to watch instantly on the web at netflix.com from your personal computer or on any internet-connected device that offers the Netflix app, including smart TVs, smartphones, tablets, streaming media players and game consoles.\n\nYou can also download your favorite shows with the iOS, Android, or Windows 10 app. Use downloads to watch while you''re on the go and without an internet connection. Take Netflix with you anywhere.')
INSERT INTO [dbo].[faq] ([Id], [question], [answer]) VALUES (4, N'How do I cancel?', N'Netflix is flexible. There are no pesky contracts and no commitments. You can easily cancel your account online in two clicks. There are no cancellation fees – start or stop your account anytime.')
INSERT INTO [dbo].[faq] ([Id], [question], [answer]) VALUES (5, N'What can I watch on Netflix?', N'Netflix has an extensive library of feature films, documentaries, TV shows, anime, award-winning Netflix originals, and more. Watch as much as you want, anytime you want.')
INSERT INTO [dbo].[faq] ([Id], [question], [answer]) VALUES (6, N'Is Netflix good for kids?', N'The Netflix Kids experience is included in your membership to give parents control while kids enjoy family-friendly TV shows and movies in their own space.\n\nKids profiles come with PIN-protected parental controls that let you restrict the maturity rating of content kids can watch and block specific titles you don’t want kids to see.')
INSERT INTO [dbo].[faq] ([Id], [question], [answer]) VALUES (8, N'Lorem, ipsum dolor sit amet consectetur adipisicing elit?', N'Lorem ipsum dolor sit amet consectetur adipisicing elit. Architecto dicta veritatis, excepturi officia velit amet, in, odio quae eum quam quo sunt totam distinctio ex quidem? Repellat aut esse nemo provident ad.')
