INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (7, 1, N'Top Gun: Maverick', N'After more than thirty years of service as one of the Navy’s top aviators, and dodging the advancement in rank that would ground him, Pete “Maverick” Mitchell finds himself training a detachment of TOP GUN graduates for a specialized mission the likes of which no living pilot has ever seen.', N'')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (8, 1, N'Samaritan', N'Thirteen year old Sam Cleary  suspects that his mysteriously reclusive neighbor Mr. Smith is actually the legendary vigilante Samaritan, who was reported dead 20 years ago. With crime on the rise and the city on the brink of chaos, Sam makes it his mission to coax his neighbor out of hiding to save the city from ruin.', N'')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (9, 1, N'Nope', N'Residents in a lonely gulch of inland California bear witness to an uncanny, chilling discovery.', N'')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (10, 1, N'DC League of Super-Pets', N'When Superman and the rest of the Justice League are kidnapped, Krypto the Super-Dog must convince a rag-tag shelter pack - Ace the hound, PB the potbellied pig, Merton the turtle and Chip the squirrel - to master their own newfound powers and help him rescue the superheroes.', N'')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (12, 2, N'House of the Dragon', N'The prequel series finds the Targaryen dynasty at the absolute apex of its power, with more than 15 dragons under their yoke. Most empires—real and imagined—crumble from such heights. In the case of the Targaryens, their slow fall begins almost 193 years before the events of Game of Thrones, when King Viserys Targaryen breaks with a century of tradition by naming his daughter Rhaenyra heir to the Iron Throne. But when Viserys later fathers a son, the court is shocked when Rhaenyra retains her status as his heir, and seeds of division sow friction across the realm.', N'1')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (13, 2, N'The Sandman', N'After years of imprisonment, Morpheus — the King of Dreams — embarks on a journey across worlds to find what was stolen from him and restore his power.', N'1')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (14, 1, N'Prey', N'When danger threatens her camp, the fierce and highly skilled Comanche warrior Naru sets out to protect her people. But the prey she stalks turns out to be a highly evolved alien predator with a technically advanced arsenal.', N'')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (15, 1, N'Day Shift', N'An LA vampire hunter has a week to come up with the cash to pay for his kid''s tuition and braces. Trying to make a living these days just might kill him.', N'')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (16, 2, N'She-Hulk: Attorney at Law', N'Jennifer Walters navigates the complicated life of a single, 30-something attorney who also happens to be a green 6-foot-7-inch superpowered hulk.', N'1')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (17, 2, N'See', N'A virus has decimated humankind. Those who survived emerged blind. Centuries later when twins are born with the mythic ability to see, their father must protect his tribe against a threatened queen.', N'1')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (18, 2, N'Game of Thrones', N'Seven noble families fight for control of the mythical land of Westeros. Friction between the houses leads to full-scale war. All while a very ancient evil awakens in the farthest north. Amidst the war, a neglected military order of misfits, the Night''s Watch, is all that stands between the realms of men and icy horrors beyond.', N'1')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (19, 2, N'Better call Saul', N'Six years before Saul Goodman meets Walter White. We meet him when the man who will become Saul Goodman is known as Jimmy McGill, a small-time lawyer searching for his destiny, and, more immediately, hustling to make ends meet. Working alongside, and, often, against Jimmy, is “fixer” Mike Ehrmantraut. The series tracks Jimmy’s transformation into Saul Goodman, the man who puts “criminal” in “criminal lawyer".', N'1')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (21, 2, N'Stranger Things', N'When a young boy vanishes, a small town uncovers a mystery involving secret experiments, terrifying supernatural forces, and one strange little girl.', N'1')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (22, 1, N'Minions: The Rise of Gru', N'A fanboy of a supervillain supergroup known as the Vicious 6, Gru hatches a plan to become evil enough to join them, with the backup of his followers, the Minions.', N'')
INSERT INTO [dbo].[resource] ([Id], [category], [name], [infos], [season]) VALUES (23, 1, N'Thor: Love and Thunder', N'After his retirement is interrupted by Gorr the God Butcher, a galactic killer who seeks the extinction of the gods, Thor Odinson enlists the help of King Valkyrie, Korg, and ex-girlfriend Jane Foster, who now inexplicably wields Mjolnir as the Relatively Mighty Girl Thor. Together they embark upon a harrowing cosmic adventure to uncover the mystery of the God Butcher’s vengeance and stop him before it’s too late.', N'')
